import React, { Component } from "react";
import ProjectSummary from "./projectSummary";
import ProjectStatus from "./projectStatus";
import NewBugButton from "./newBugButton";

class ProjectHeader extends Component {
  render() {
    return (
      <div id="project-summary-panel">
        <div className="test-border" id="project-title">
          {/* <h2>{this.props.project.projectTitle}</h2> */}
          <h2>
            {this.props.project.projectId} - {this.props.project.projectTitle}
          </h2>
          {/* <p>{this.props.project.projectId}</p> */}

          {/* <h2>This will be the project title</h2> */}
        </div>
        <div id="summary-panel">
          <NewBugButton />
          <div className="test-border" id="summary-divider-panel">
            <div id="project-stats">
              <ProjectSummary project={this.props.project} />
            </div>
            <div id="project-status">
              <ProjectStatus project={this.props.project} />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ProjectHeader;
